import React, { Component } from 'react';
import './App.css';
import AppNavbar from './AppNavbar';
import { Link } from 'react-router-dom';
import { Button, Container, Carousel} from 'react-bootstrap';

class Course extends Component{
    render() {
        return(
            <div>
                <AppNavbar/>
                <Container className={"coursesContainer"} fluid>
                    <Carousel interval={2000}>
                        <Carousel.Item>
                            <img
                                className="d-block w-100"
                                src="data:image/png;base64,"
                                alt="Binary"
                            />
                            <Carousel.Caption>
                                <h3>Binary Number System Course</h3>
                                <Button variant="info" href="/courses/binary">Binary Course</Button>
                            </Carousel.Caption>
                        </Carousel.Item>
                        <Carousel.Item>
                            <img
                                className="d-block w-100"
                                src="data:image/png;base64,"
                                alt="Octal"
                            />
                            <Carousel.Caption>
                                <h3>Octal  Number System Course</h3>
                                <Button variant="info" href="/courses/octal">Octal Course</Button>
                            </Carousel.Caption>
                        </Carousel.Item>
                        <Carousel.Item>
                            <img
                                className="d-block w-100"
                                src="data:image/png;base64,"
                                alt="Hexadecimal"
                            />
                            <Carousel.Caption>
                                <h3>Hexadecimal Number System Course</h3>
                                <Button variant="info" href="/courses/hexadecimal">Hexadecimal Course</Button>
                            </Carousel.Caption>
                        </Carousel.Item>
                    </Carousel>
                </Container>
            </div>
        )
    }
}

export default Course;